// src/components/QRCodeDisplay.js
import React from 'react';
import QRCode from 'qrcode.react';

const QRCodeDisplay = ({ value }) => {
  return (
    <div>
      <h2>QR Code</h2>
      <QRCode value={value} />
    </div>
  );
};

export default QRCodeDisplay;
